import React from 'react';
import {BrowserRouter, Route, Switch, withRouter} from 'react-router-dom';
import Index from './pages/index';
// Student Routes
import StudentDashboard from './pages/student/student-dashboard';
import StudentMyCourses from './pages/student/student-my-courses';
import StudentResults from './pages/student/student-quiz-results';
import StudentResultsDetails from './pages/student/student-quiz-result-details';
import StudentProfile from './pages/student/student-profile';
import StudentAccount from './pages/student/student-edit-account';
import StudentAccountPassword from './pages/student/student-edit-account-password';
import StudentAccountProfile from './pages/student/student-edit-account-profile';
import StudentTakeCourse from './pages/student/student-take-course';
import StudentTakeLesson from './pages/student/student-take-lesson';
import StudentTakeQuiz from './pages/student/student-take-quiz';
import StudentPathAssessResult from './pages/student/student-path-assessment-result';
import StudentAccountNotifications from './pages/student/student-edit-account-notifications';
import StudentPathAssess from './pages/student/student-path-assessment';
import StudentBilling from './pages/student/student-billing';
import StudentBillingHistory from './pages/student/student-billing-history';
import StudentBillingInvoice from './pages/student/student-billing-invoice';
import StudentBillingUpgrade from './pages/student/student-billing-upgrade';
import StudentBillingPayment from './pages/student/student-billing-payment';
import StudentDiscussAsk from './pages/student/student-discussions-ask';
import StudentDiscussion from './pages/student/student-discussion';
import StudentDiscussions from './pages/student/student-discussions';
import StudentChangePassword from './pages/student/student-change-password';
// Instructor Routes
import InstructorDashboard from './pages/instructor/instructor-dashboard';
import InstructorCourses from './pages/instructor/instructor-courses';
import InstructorEditCourse from './pages/instructor/instructor-edit-course';
import InstructorQuizzes from './pages/instructor/instructor-quizzes';
import InstructorEditQuiz from './pages/instructor/instructor-edit-quiz';
import InstructorEarnings from './pages/instructor/instructor-earnings';
import InstructorStatement from './pages/instructor/instructor-statement';
import InstructorProfile from './pages/instructor/instructor-profile';
//general Routes
import Pricing from './pages/pricing';
import Paths from './pages/paths';
import Lessons from '.pages/lesson';
import Path from './pages/path';
import Login from './pages/login';
import SignUp from './pages/signup';
import SignupPayment from './pages/signup-payment';
import ResetPassword from './pages/reset-password';
import ChangePassword from './pages/change-password';
import Library from './pages/library';
import LibraryDevelopment from './pages/library-development';
import LibraryFilterDevelopment from './pages/library-filters-development';
import LibraryFilterDevelopmentList from './pages/library-filters-development-list';
import Course from './pages/course';
import LibraryFeatured from './pages/library-featured';
import LibraryFilterList from './pages/library-filters-list';
import LibraryFilters from './pages/library-filters';

import NotFound from './pages/not-found';
import Alert from 'react-s-alert';
import 'react-s-alert/dist/s-alert-default.css';
import 'react-s-alert/dist/s-alert-css-effects/scale.css';
// import './index.css';

const Router = () => {
  return (
    <BrowserRouter >
      <Switch>
        <Route exact path="/" component={Index}/>
        <Route exact path="/index" component={Index}/>
        <Route path="/student-dashboard" component={StudentDashboard} />
        <Route path="/student-my-courses" component={StudentMyCourses} />
        <Route path="/student-quiz-results" component={StudentResults} />
        <Route path="/student-take-course" component={StudentTakeCourse} />
        <Route path="/student-take-lesson" component={StudentTakeLesson} />
        <Route path="/student-take-quiz" component={StudentTakeQuiz}/>
        <Route path="/student-quiz-result-details" component={StudentResultsDetails} />
        <Route path="/student-path-assessment" component={StudentPathAssess} />
        <Route path="/student-path-assessment-result" component={StudentPathAssessResult} />
        <Route path="/student-edit-account" component={StudentAccount} />
        <Route path="/student-edit-account-profile" component={StudentAccountProfile} />
        <Route path="/student-edit-account-notifications" component={StudentAccountNotifications} />
        <Route path="/student-edit-account-password" component={StudentAccountPassword}/>
        <Route path="/student-billing" component={StudentBilling} />
        <Route path="/student-billing-upgrade" component={StudentBillingUpgrade} />
        <Route path="/student-billing-payment" component={StudentBillingPayment} />
        <Route path="/student-billing-history" component={StudentBillingHistory} />
        <Route path="/student-billing-invoice" component={StudentBillingInvoice}/>
        <Route path="/student-discussions" component={StudentDiscussions} />
        <Route path="/student-discussion" component={StudentDiscussion} />
        <Route path="/student-discussions-ask" component={StudentDiscussAsk} />
        <Route path="/student-profile" component={StudentProfile} />
        <Route path="/student-change-password" component={StudentChangePassword} />


        <Route path="/instructor-dashboard" component={InstructorDashboard} />
        <Route path="/instructor-courses" component={InstructorCourses} />
        <Route path="/instructor-quizzes" component={InstructorQuizzes} />
        <Route path="/instructor-edit-course" component={InstructorEditCourse} />
        <Route path="/instructor-edit-quiz" component={InstructorEditQuiz} />
        <Route path="/instructor-earnings" component={InstructorEarnings} />
        <Route path="/instructor-statement" component={InstructorStatement} />
        <Route path="/instructor-profile" component={InstructorProfile} />

        <Route path="/pricing" component={Pricing} />
        <Route path="/login" component={Login} />
        <Route path="/signup" component={SignUp} />
        <Route path ="/lesson" component = {Lessons} />
        {/* <Route path="/investment-details/:id" component={InvestmentDetails} /> */}
        <Route path="/signup-payment" component={SignupPayment} />
        <Route path="/reset-password" component={ResetPassword} />
        {/* <Route path="/premium-details/:id" component={PremiumDdetails} /> */}
        <Route path="/change-password" component={ChangePassword} />
        <Route path="/course" component={Course} />
        <Route path="/library" component={Library} />
        <Route path="/library-featured" component={LibraryFeatured} />
        <Route path="/library-development" component={LibraryDevelopment} />
        <Route path="/library-filters" component={LibraryFilters} />
        <Route path="/library-filters-list" component={LibraryFilterList} />
        <Route path="/library-filters-development" component={LibraryFilterDevelopment} />
        <Route path="/library-filters-development-list" component={LibraryFilterDevelopmentList} />
        <Route path="/paths" component={Paths} />
        <Route path="/path" component={Path} />
        <Route component={NotFound} />
      </Switch>
      <Alert stack={{limit: 3}} />
    </BrowserRouter>
  );
};
export default Router;
